<h2><span style="font-weight: bold; font-size: 18px;">Synergy ITC</span></h2>
<br>
<h2>Content Delivery and Management System</h2>
<p><em>Synergy ITC</em> is the content delivery and management system for Pitsco Education curriculum. It provides instructors with the tools needed to schedule students into curriculum content and manage their grades received in that content.</p>
<p><em>Synergy</em> <em>ITC</em> also delivers content to students, including images, graphics, videos, and audio-based instruction. All of this is handled from the cloud.</p>
<p><em>Synergy ITC</em> includes a secure login feature that ensures students
work on individually assigned content and receive grades for only their
work.&nbsp;</p>
<p><em>Synergy</em> <em>ITC</em> is built upon a proprietary engine that leverages technologies such as PHP, MySQL, and JavaScript in a way that provides a consistent framework for development. </p>
<h2>Client Access to <em>Synergy ITC</em></h2>
<p>Content is delivered from a cloud server through an internet browser. Access to the majority of pages within <em>Synergy ITC</em> is based on
standard AJAX and Dynamic HTML techniques. Modules is a Flash based
product while IPLs and Expeditions are HTML5 products, all delivered
through ITC. Local browser caching of media helps relieve network load. </p>
<p>Students and teachers can access <em>Synergy</em> <em>ITC</em> via any of the supported browsers. The browser must have JavaScript enabled in order to access and utilize <em>Synergy ITC</em>. The following browsers are supported:</p>
<ul>
    <li>Google Chrome 25.x or newer</li>
    <li>Firefox 19.x or newer</li>
    <li>Internet Explorer 11</li>
    <li>Safari 5.x or newer</li>
</ul>
<h2>Module Lab Configuration and Specifications</h2>
<p>Several of the Modules contain third-party applications that must be installed on the local machine.*</p>
<p>Examples of such applications include Microsoft <em>Flight Simulator</em> and <em>Easy Media Creator</em>. The operating system requirements are dictated for those titles by the software requirements of the third-party title. Installation instructions are provided.</p>
<p>*Third-party software is not compatible with Mac OS computers.</p></div><div class="clear"></div></td></tr></tbody></table><div class="clear"></div></div>
